import React from 'react';
import {Col, Row} from "react-bootstrap";

const NewCard = ({New}) => {
    return (

            <Row className={'newCard'}>
                <Col md={3} className={'newCardImage'}>
                    <img src={New.urlToImage}/>
                </Col>
                <Col md={6} className={'newCardText'}>
                    <div className={'newCardTitle'}>
                        {New.title}

                    </div>
                    <div  className={'newCardDescription'}>
                        {New.description}
                    </div>
                </Col>
                <div className={'publishedAt'}>
                    Опубликовано: {New.publishedAt}
                </div>
            </Row>

    );
};

export default NewCard;
